import Cart from "../Cart/cart";

import { Link, useParams, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";
import { ShopperDetails } from "../Shopper-Details/shopper-details";
import { useCookies, Cookies } from "react-cookie";
import './Shopper-Category.css';

export function ShopperCategory() {
    const params = useParams();
    const [products, setProducts] = useState([]);
    const [cartItems, setCartItems] = useState([]);
//   const [cartItemsCount, setCartItemsCount] = useState(0);
    const [cookies, setCookie, removeCookie] = useCookies(["user"]);

    const navigate = useNavigate();

    function removeCartItem(e) {
        alert(`Remove from cart`);
        cartItems.splice(e.currentTarget.id, 1);
        setCartItemsCount(cartItems.length);
      }
    
      function clear() {
        alert(`clear cart`);
        setCartItems([]);
        setCartItemsCount(0);
      }

    useEffect(() => {
        if (!cookies["userId"]) {
            navigate("/login");
        }
        axios({
            method: "get",
            url: `https://fakestoreapi.com/products/category/${params.catname}`,
        }).then((response) => {
            setProducts(response.data);
        });
    }, [params.catname]);
    const SignoutClick = () => {
        removeCookie("userId");
        navigate("/login");
    };

    return (
        <div>
            <div className="container-fluid">
                <div className="d-flex justify-content-between align-items-center mb-3">
                    <h2 className="text-capitalize">{params.catname} - {cookies["userId"]}
                    </h2>
                    <button onClick={SignoutClick} className="btn btn-link">Signout</button>
                </div>
                <div className="row">

                    <div className="col-10 d-flex flex-wrap">
                        {
                            products.map((product) => (
                                <div className="card m-2 p-2" style={{ width: "200px" }}>
                                    <img alt={product.title} src={product.image} height={"150px"} className="card-img-top" />
                                    <div className="card-header" style={{ height: "150px" }}>
                                        <p>{product.title}</p>
                                    </div>
                                    <div className="card-footer">
                                        <Link to={'/details/' + product.id} className="btn btn-primary w-100">Details</Link>
                                    </div>
                                    <div>
                                        <Link to={'/cart/' + product.id} className="btn btn-primary w-100">Add to Cart</Link>
                                    </div>

                                </div>
                            ))
                        }
                    </div>
                    <div className="col-2">
                    <div className="col-2">
          <h3>Your Cart Items</h3>
          <table className="table table-hover">
            <thead>
              <tr>
                <th>Title</th>
                <th>Preview</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {cartItems.map((item) => (
                <tr>
                  <td>{item.title}</td>
                  <td>
                    <img src={item.image} height={50} />
                  </td>
                  <td>
                    <button
                      name={item.id}
                      onClick={removeCartItem}
                      className="btn btn-danger"
                    >
                      <span className="bi bi-trash"></span>
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
            <tfoot>
              <tr>
                <td colSpan={3}>
                  <button onClick={clear} className="btn btn-primary">
                    Clear Cart
                  </button>
                </td>
              </tr>
            </tfoot>
          </table>
        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
